import React, { useEffect, useState } from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'


function Read() {
    const {id} = useParams();
    const [food, setFood] = useState([])
    useEffect(() => {
        axios.get('http://localhost:8081/read/'+id)
        .then(res => {
        setFood(res.data);
    })

        .catch(err => console.log(err))
    },[])

  return (
    <div>Read</div>
  )
}

export default Read
